INSERT INTO `terms_and_conditions` (`conditions`) VALUES
('**Authorized Use**'),
('The School Management System is intended for use by authorized'),
('school personnel, including administrators, teachers, and parents,'),
('solely for managing school-related activities and student information.'),
('  '),
('**Data Ownership**'),
('The school retains full ownership and responsibility for all data '),
('entered into the system. Data will be treated with the utmost '),
('confidentiality and will not be shared with any third parties without '),
('explicit consent or legal requirement.'),
('  '),
('**User Responsibilities**'),
('Each user is responsible for maintaining the security and confidentiality '),
('of their login credentials. Users must not share their login information '),
('with others, and any suspicious activity should be reported immediately.'),
('  '),
('**Compliance with Laws**'),
('Users are required to adhere to all applicable laws, regulations, and '),
('school policies while using the School Management System. Any misuse'),
('or unauthorized access may result in disciplinary actions.'),
('  '),
('**System Integrity**'),
('Users must not attempt to disrupt or interfere with the system\'s '),
('functioning, including attempting to access or modify data '),
('beyond their authorized access level.'),
('   '),
('**Backup and Data Loss**'),
('While the system implements regular data backups, the school is '),
('responsible for maintaining additional backups and acknowledging '),
('that the system administrators are not liable for any data loss.'),
('  '),
('**Technical Limitations**'),
('The school acknowledges that, while efforts are made to ensure '),
('system reliability, occasional downtimes or technical issues may '),
('occur, and the system administrators will work diligently to resolve them.'),
('  '),
('**Acceptance of Terms**'),
('By using the School Management System, users agree to abide by these '),
('terms and conditions. Failure to comply with these terms may result in '),
('the suspension or termination of user access.'),
('  ');
